import GiftSpot from './charlesComponents/giftspot';
import SoapSpotThree from './charlesComponents/s';




function App() {
  return (
    <div className="App">
      <Top />
      <Banner />
      <SoapSpot />
      <EmptySpace />
      <Seasonal />
      <SoapSpotTwo />
      <GiftSpot />
      <SoapSpotThree />
      <Charles />
      <Footer />
    </div>
  );
}

export default App;
